- input: "TEXT\x1CC00432591\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commission's Request for Further Information regarding the 12 Day Pre-Primary
    Report for 2008.  The Committee has merged duplicates in the database that were
    from donors using different addresses for online contributions vs. contributions
    by check.  This is often caused by donors having a work address assigned to their
    credit cards but their home address on their checks.  The Committee utilizes all
    measures possible to find duplicates within its database prior to filing reports
    but unfortunately some inadvertently slip through.  An excessive contribution
    in question for Barbara Farmilant was not actually an excess contribution. $2,300
    came in on 9/30 and was then refunded on 9/30.  The donor then donated again on
    10/15 for an aggregate of $2,300 for G2008 This is reflected on the amended October
    Quarterly Report.  Bobette Gorden's contribution on 10/8 for $100 did cause an
    excessive contribution and this has been refunded on 12/4 and will be reflected
    on the Year End Report for 2008.  -  In addition it was discovered that the Committee
    inadvertently missed two credit card fees totaling $42.59 that came in on a bank
    statement after the report was filed.  $32.59 to Chase Payment Tech Services and
    $10.00 to Authorize.net both on 8/4/2008."
